import React from 'react';
import ReactDOM from 'react-dom';

function Output(){
    const csvData = fetch('drinks.csv');
    const data = []
                    .push(csvData);

    function DataList (props){
        const data = props.data;
        const listRows = data. map((columns) =>
            <li>{columns}</li>
        );
        return(
            <ul>{listRows}</ul>
        )
    }
    
    const row = data.toString().slice(1);

    Array.prototype.forEach.call(data.row, row => {
        const columns = row.split(',');
        const country = columns[0];
        const beer = columns[1];
        const spirit = columns[2];
        const wine = columns[3];
        const total = columns[4];
    })
    console.log(data);
    
    ReactDOM.render(
        <Output data = {data} />,
        document.getElementById('root')
    );
    
}

  export default Output;
